function Joke() {
    const [joke, setJoke] = useState({});

    useEffect(() => {
        fetch('https://official-joke-api.appspot.com/jokes/programming/random')
            .then(response => response.json())
            .then(json => {
                console.log('joke json', json);
                setJoke(json);
            });

    }, []);

    const {setup, punchline} = joke;

    return (
        <div>
            <h3>Joke</h3>
            {/* <p>{setup}</p>
